using System;

namespace AlternatingCharacters
{
    class Program
    {
        static int alternatingCharacters(string s)
        {
            int result = 0;
            int index = 0;
            while  (index >= 0)
            {
                result = findCharacters(ref s, ref index, result);
            }

            return result;

            
        }

        static int findCharacters( ref string s, ref int index, int result)
        {
            
           int findIndex = s.IndexOf(searchCharacter(s[index]), index + 1);             
            if(findIndex>index)
            {
                result = result + findIndex - index-1;
               // s = s.Substring(findIndex);                
            }
            else
            {
                if (s.Length > 0)
                {
                    result = result + s.Length-index - 1;
                }
                //s = "";
            }
            index = findIndex;
            return result;
        }

        static char searchCharacter(char c)
        {
            if (c == 'A')
                return 'B';
            else
                return 'A';
        }
       
        static void Main(string[] args)
        {
            string s = "";

            //"AAABBB"
            int res = alternatingCharacters(s);
            Console.WriteLine(res);
            Console.ReadLine();
        }
    }
}
